import React from 'react';
import Blog from '../Blog/Blog';

const blogs = [
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/visit-768x513.jpeg",
        name: 'A PLACE TO VIST',
        location: 'Sent Martin (CoxsBazar)'
    },
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/adventure-768x513.jpeg",
        name: 'ADVANTURE IN HILL',
        location: 'Furomon Hill(Rangamati)'
    },
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/resort-768x513.jpeg",
        name: 'POLYEL RESORT',
        location: 'Reserve Bazar(Rangpur)'
    },
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/journey-768x513.jpeg",
        name: 'INCREDIBLE JOURNEY',
        location: 'Nafakum(Bandarbans)'
    },
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/55-768x513.jpeg",
        name: 'TAKE ME TO TOP',
        location: 'potenga(Chittagong)'
    },
    {
        img: "https://www.ceylondetour.com/wp-content/uploads/2018/04/pexels-photo-753626-768x513.jpeg",
        name: 'HOLYDAT IN DC BANGLO',
        location: 'Kaptai Lake (Rangamati)'
    },
]

const Experts = () => {
    return (
        <div id="blogs" className="container">
            <h2 className="text-dark fw-bolder m-5"> BEST TOUR BLOGS IN BANGLADESH </h2>
            <div className="row bg-success bg-opacity-10">
                {
                    blogs.map(blog => <Blog
                        key={blog.name}
                        blog={blog}
                    >

                    </Blog>)
                }
            </div>
        </div>
    );
};

export default Experts;
